        );
    }

    getManufacturerListAll() {
        return axios.get(`${API_URL}/api/manufacturer/`, {
        });
    } 

    updateManufacturer(json) {
        return axios.put(`${API_URL}/api/manufacturer/`, json, {
        });
    }

}
export default new ManufacturerService();
